import React from "react";

const checkbox = (name, text) =>
{
    return(
      <div className="checkbox-item">
        <span className="checkbox-text textsm">{text}</span>
        <input type="checkbox" className="checkbox" name={name}/>
      </div>
    )
}

export default checkbox
